import React from 'react';
import useCartStore from '../store/cart.store';

function Cart() {
  const { cartList } = useCartStore();

  // 카트에 추가된 각 상품의 정보를 매핑하여 JSX로 변환
  const cartItems = cartList.map((item, index) => (
    <div key={index}>
      상품 정보:{it} 온도: {item.productTemperature}, 사이즈: {item.productSize}, 수량: {item.productAmount}
    </div>
  ));

  return (
    <div>
      장바구니 
      <div>
        {cartItems}
        <div>
          총가격: {/* 여기에 총가격을 계산하여 출력하는 코드를 추가하면 됩니다 */}
        </div>
        <div>
          <div>전체 취소</div>
          <div>결제</div>
        </div>
      </div>
    </div>
  );
}

export default Cart;
